import React, { Component } from 'react';

export default class Contact extends Component {
  render() {
    return (
      <form action="#" method="POST" role="form" netlify>
        <label class="form-label" for="name">
          <input type="text" class="form-control" name="name" placeholder="Name" tabindex="1" required /></label>

        <label class="form-label" for="email">
          <input type="email" class="form-control" name="email" placeholder="Email" tabindex="2" required /></label>


        <label class="form-label" for="phone">
          <input type="tel" class="form-control" name="phone" placeholder="Phone Number" tabindex="3" /></label>


        <label class="form-label" for="message">
          <textarea rows="5" cols="50" name="message" class="form-control" placeholder="Message..."
            tabindex="4" required></textarea></label>

        <div class="text-center">
          <button type="submit" class="btn btn-start-order">Send Message</button>
        </div>
      </form>
    )
  }
}
